// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundGetterLogicV0 {
    /// @dev All PRs that modify this struct *must* be coordinated with an
    /// engineer on the Web3 dashboard, because it is returned directly by
    /// `getSyndicateValues()`
    struct SyndicateValues {
        address managerCurrent;
        address managerPending;
        address managerFeeAddress;
        uint256 managerManagementFeeBasisPoints;
        uint256 managerDistributionShareBasisPoints;
        uint256 syndicateDistributionShareBasisPoints;
        uint256 numMembersMax;
        uint256 numMembersCurrent;
        address depositERC20Address;
        uint256 depositMemberMin;
        uint256 depositMemberMax;
        uint256 depositTotalMax;
        uint256 depositTotal;
        uint256 dateCreated;
        uint256 dateClose;
        bool open;
        bool distributing;
        bool modifiable;
        bool allowlistEnabled;
        bool transferable;
    }

    struct MemberInfo {
        uint256 deposit;
        uint256 distributionClaimedDepositERC20;
        bool isAllowlisted;
    }

    function getSyndicateValues(address syndicateAddress)
        external
        returns (SyndicateValues memory);

    function getMemberInfo(address syndicateAddress, address memberAddress)
        external
        returns (MemberInfo memory);

    function getMetadata(address syndicateAddress, string calldata metadataKey)
        external
        returns (string calldata);
}
